import styled from "styled-components";
import { Navbar, Form } from "react-bootstrap";
import { mobile } from "../responsive";

const StyledNavbar = styled(Navbar)`
  background-color: dark;
  padding: 10px 0;
`;

const Brand = styled(Navbar.Brand)`
  font-size: 30px;
  font-weight: 900;
`;

const StyledForm = styled(Form)`
  ${mobile({ width: "80%" })};
`;

const SearchInput = styled(Form.Control)`
  // Your styles for the search input
`;

const ReloadButton = styled(Btn)`
  // Your styles for the reload button
`;

const Header = ({ location, reload, handlecheck }) => {
  return (
    <StyledNavbar bg="dark" data-bs-theme="dark">
      <Container>
        <Brand className="ml-auto">Weather Data</Brand>
        <Nav className="ml-auto">
          <StyledForm inline>
            <Row>
              <Col>
                <SearchInput
                  type="text"
                  placeholder="Search"
                  className=" mr-sm-2"
                  value={location}
                  onChange={handlecheck}
                />
              </Col>
              <Col xs="auto">
                <ReloadButton onClick={reload} type="submit">
                  Reload
                </ReloadButton>
              </Col>
            </Row>
          </StyledForm>
        </Nav>
      </Container>
    </StyledNavbar>
  );
};

export default Header;
